import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';

function App() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [successMessage, setSuccessMessage] = useState(false);
  const [firstNameError, setFirstNameError] = useState('');
const [lastNameError, setLastNameError] = useState('');
const [emailError, setEmailError] = useState('');
const [phoneError, setPhoneError] = useState('');
  
const handleSubmit = (event) => {
  event.preventDefault();

  // Reset validation errors
  setFirstNameError('');
  setLastNameError('');
  setEmailError('');
  setPhoneError('');

  // First Name validation
  if (!firstName) {
    setFirstNameError('First Name is required');
  }

  // Last Name validation
  if (!lastName) {
    setLastNameError('Last Name is required');
  }

  // Email validation
  if (!email) {
    setEmailError('Email address is required');
  } else if (!/\S+@\S+\.\S+/.test(email)) {
    setEmailError('Invalid email address');
  }

  // Phone Number validation
  if (!phone) {
    setPhoneError('Phone Number is required');
  } else if (!/^\d{10}$/.test(phone)) {
    setPhoneError('Invalid phone number (10 digits required)');
  }

  // Submit the form if there are no validation errors
  if (!firstNameError && !lastNameError && !emailError && !phoneError) {
    // Perform form submission logic here
    alert('Form submitted successfully!');
    
    setFirstName('');
    setLastName('');
    setEmail('');
    setPhone('');
  }
};
    
  return (
    <div className="container mt-5  ">
      <h1 className="text-center">Contact Details Form</h1>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formFirstName">
          <Form.Label>First Name</Form.Label>
          <div class="col-auto">
          <Form.Control 
            type="text"
            placeholder="Enter your first name"
            value="firstName"
            onChange={(e) => setFirstName(e.target.value)}
            required
          />
          </div>
          {firstNameError && <p className="text-danger">{firstNameError}</p>}
        </Form.Group>

        <Form.Group controlId="formLastName">
          <Form.Label>Last Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your last name"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
            required
          />
          {lastNameError && <p className="text-danger">{lastNameError}</p>}
        </Form.Group>

        <Form.Group controlId="formEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter your email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
          {emailError && <p className="text-danger">{emailError}</p>}
        </Form.Group>

        <Form.Group controlId="formPhone">
          <Form.Label>Phone Number</Form.Label>
          <Form.Control
            type="tel"
            placeholder="Enter your phone number"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            required
          />
          {phoneError && <p className="text-danger">{phoneError}</p>}
        </Form.Group>
<div className="text-center mt-2"
>
        <Button 
        onSubmit={handleSubmit}
        variant="primary" type="submit">
          <div>{successMessage && <p className="mt-3 text-success">Form submitted successfully!</p>}</div>Submit
            
          
        </Button>
        </div>
      </Form>
    </div>
  );
}

export default App;
